import React from "react";

const Benefits = () => {
    return (
        <section id="benfits" className="py-5 benefits">
            <div className="container text-center">
                <h2>Why Sketch Motion?</h2>
                <ul className="list-unstyled mt-3">
                    <li>Easy animation tools for hobbyist and creators.</li>
                    <li>Seamless uploads for your artwork.</li>
                    <li>Bring your ideas to life with intuitive AI tools.</li>
                </ul>
            </div>
        </section>
    );
};

export default Benefits;
